import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import "./ReviewList.css";
import "./Modal.css";
import Modal from "./Modal";

interface Review {
  id: number;
  store_id: number;
  rating: number;
  comment: string;
}

const ReviewList: React.FC = () => {
  const { storeId } = useParams<{ storeId: string }>();
  const [reviews, setReviews] = useState<Review[]>([]);
  const [error, setError] = useState<string | null>(null);
  const [showModal, setShowModal] = useState(false);

  // 新規コメント投稿用のステート
  const [newRating, setNewRating] = useState<number>(5);
  const [newComment, setNewComment] = useState<string>("");


  useEffect(() => {
    const fetchReviews = async () => {
      try {
        const response = await fetch(`http://localhost:5003/reviews`);
        if (!response.ok) {
          throw new Error("口コミ情報の取得に失敗しました");
        }
        const data: Review[] = await response.json();
        const filteredReviews = data.filter((review) => review.store_id === Number(storeId));
        setReviews(filteredReviews);
      } catch (error) {
        console.error(error);
        setError("口コミの取得に失敗しました");
      }
    };
    fetchReviews();
  }, [storeId]);

  // 新規コメント投稿のハンドラー
  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    if (!newComment.trim()) {
      setError("コメントが空です");
      return;
    }
    try {
      const newReviewData = {
        store_id: Number(storeId),
        rating: newRating,
        comment: newComment.trim()
      };

      const response = await fetch(`http://localhost:5003/reviews`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(newReviewData),
      });

      if (!response.ok) {
        throw new Error("コメント投稿に失敗しました");
      }

      const createdReview = (await response.json()) as Review;
      // 新たに投稿したコメントをreviewsに追加
      setReviews((prev) => [...prev, createdReview]);

      // フォームクリア
      setNewComment("");
      setNewRating(5);
      setError(null);
    } catch (error) {
      console.error(error);
      setError("コメント投稿に失敗しました");
    }
  };

  let content;
  if (error && reviews.length === 0) {
    content = <div>{error}</div>;
  } else if (reviews.length === 0) {
    content = <div style={{ padding: "20px" }}>まだ口コミはありません</div>;
  } else {
    content = (
      <>
        {reviews.map((review) => (
          <div key={review.id} className="review-card">
            <p className="review-rating"><strong>評価:</strong> {review.rating}</p>
            <p className="review-comment"><strong>コメント:</strong> {review.comment}</p>
          </div>
        ))}
      </>
    );
  }

  return (
    <div className="review-container">
      <h2 className="review-title">口コミ一覧</h2>
      <button onClick={() => setShowModal(true)} style= {{ marginTop: "20px"}}>投稿</button>
      {error && reviews.length > 0 && <p style={{ color: "red" }}>{error}</p>}
      {content}
      {/* 新規コメント投稿フォーム */}
      <form onSubmit={handleSubmit} style={{ marginTop: '20px' }}>
        <div style={{ marginBottom: '10px' }}>
          <label>
            評価:
            <input
              type="number"
              value={newRating}
              onChange={(e) => setNewRating(Number(e.target.value))}
              min={1}
              max={5}
              style={{ marginLeft: '10px', width: '60px' }}
            />
          </label>
        </div>
        <div style={{ marginBottom: '10px' }}>
          <label>
            コメント:
            <textarea
              value={newComment}
              onChange={(e) => setNewComment(e.target.value)}
              style={{ width: '100%', height: '80px', marginLeft: '10px' }}
            />
          </label>
        </div>
      </form>

      <Modal show={showModal} onClose={() => setShowModal(false)} onSubmit={handleReviewSubmit}  />
    </div>
  );
};

export default ReviewList;
